const app = getApp()

Page({
  data: {
    newImgSrc :"data:image/png;base64,",
  },
  onLoad() {
    console.log(' API  Bug ')
    console.log('https://mp.weixin.qq.com/debug/wxadoc/dev/devtools/devtools.html')
    
    //
    //<> wx.saveImageToPhotosAlbum
    //<> ,??

    this.saveImage();
  
  },saveImage: function() { 
    const that = this;
    
    var qrcode = that.data.newImgSrc ;//base64
  
    const fs = wx.getFileSystemManager();
    //
    var times = new Date().getTime();
    var codeimg = wx.env.USER_DATA_PATH + '/' + times + '.png';
    var img = qrcode.replace("data:image/png;base64,", "");
     
    fs.writeFile({
      filePath: codeimg,//
      data: wx.base64ToArrayBuffer(img) ,//base64
      encoding: 'base64',
      success: function(res){  
        // 
        console.log(res)
        wx.saveImageToPhotosAlbum({
          filePath: codeimg,//
          success: function (data) { 
            //..
            console.log(data)
          },
          fail: function (err) {
            //..
            console.log(err)
          }
        })

      },fail: function(e){
        console.log(e);
      }
    });
  
 
  },
})
